import Link from "next/link";

const Index = () => (
  <div className="container">
    <h1 className="text-muted">
      Welcome to Mister Excel Tutorials site! This is designed with Next.js!
      Please{" "}
      <Link href="/contact">
        <a>contact me</a>
      </Link>{" "}
      to get more information.
    </h1>
    <img src="/ahunter_rounded.png" alt="Alvison Hunter Arnuero" />
  </div>
);

export default Index;
